import testImage from "../svg/test.svg";
import TodaysForecast from "./TodaysForecast";
import DetailedForecast from "./DetailedForecast";
import SevenDayForecast from "./SevenDayForecast";
import sunny from '../svg/sunny.svg';
import cloudy from '../svg/cloudy.svg';
import rainy from '../svg/rainy.svg';
import sunnyRainy from '../svg/sunny-rainy.svg';
import thunder from '../svg/thunder.svg';


const Forecast = () => {
    const weatherIcons = [sunny, cloudy, rainy, sunnyRainy, thunder];
    return (  
        <div>
            {/* window for forecast */}
            <div>
                {/* city and forecast */}
                <div>
                    <div>Tbilisi</div>
                    <div>Sunny</div>
                    
                    <img src={testImage} alt="icon not found" />

                    <div>31°</div>
                </div>

                <TodaysForecast />
                <DetailedForecast />
                <SevenDayForecast />
            </div>
        </div>
    );
}
 
export default Forecast;

